OneTo1.SelfHelpController=Ember.ObjectController.extend({categories:[],sub_categories:[],articles:[],loading_categories:false,loading_subcategories:false,actions:{back:function(){window.history.back()},quit:function(){this.transitionToRoute("landingPage")},showSubCategories:function(b){this.set("sub_categories",[]);$(".category .loading").css("display","none");$(".category .subcategory").css("display","none");$((".category ."+b.identifier)).css("display","inline");var a=this;$.ajax({type:"GET",url:"http://service.1to1help.net/rest/json/metallica/subcategory/"+b.catId,dataType:"json",contentType:"application/JSON",success:function(c){a.set("sub_categories",c);$(".category .loading").css("display","none")},error:function(c){alert("error")}})},goToArticlesList:function(a){microcache.set("sub"+a.subCatId,a);this.transitionToRoute("/articlesList/"+a.subCatId)}}});